import Link from "next/link"
const Navbar = () => (
    <div>
    <ul>
        <li><Link href="/"><a>Home</a></Link></li>
        <li><Link href="/hello"><a>Hello World</a></Link></li>
    </ul>

    <style jsx>{`
        ul{
            background : #000;
            color : #fff;
            list-style : none;
            display : flex;
        }
        ul li{
            margin-right : 20px;
            font-size : 18px;
        }
        ul li a{
            text-decoration : none;
            color : #fff;
        }
        `}
    </style>
    </div>
)

export default Navbar
